Despite having a relatively small number of releases and remixes to his name, Tensnake\'s output belies his immense reputation. An undoubted proponent of the quality-over-quantity mantra, his sound is as instantly recognisable as it is infectious. \'Mainline\' is a hooky, bass-driven house anthem of the very highest order, and features the assured vocal performance from the acclaimed Rudimental collaborator and Radio 1 Xtra favourite Syron.

With a thumpingly retro bassline, snappy 909-styled hats and a chopped and re-pitched vocal which winds its way around the main refrain, \'Mainline\' is a positive and worthy reimagining of the \'glory days\' of house music. With its feel-good, retro house stylings and assured vocal performance, the new release from Tensnake looks set to be as big as its feline predecessor.

