Darf Clubmusik auch ausnahmsweise mal melancholisch sein? Auf jeden Fall, sie muss sogar! Zumindest wenn es nach den französischen Alternative-Pop-Folk-Superstars Nili Hadida und Benjamin Cotto alias Lilly Wood & The Prick geht, deren Ohrwurm „Prayer in C" sich der Osnabrücker DJ, Producer und Labelbesitzer Robin Schulz kurzerhand angenommen und zu einer funkelnden Dancefloor-Perle veredelt hat!

Schon Anfang des Jahres konnte Lausbuben Records-Chef und Star-DJ Robin Schulz mit seiner Single „Sunset" in die Top 40 der deutschen iTunes-Charts einsteigen; mit seinem „Waves"-Remix des niederländischen Rappers Mr. Probz hat er im vergangenen März niemand Geringeren als Pharrell Williams vom Charts-Thron geschubst und es sich auf Platz 1 der deutschen Single-, iTunes-, Airplay- und Dance-Hitparade gemütlich gemacht. Damit aber nicht genug, denn auch auf internationaler Ebene ist Robin Schulz mehr als erfolgreich. So macht Robin Schulz es sich derzeit mit dem „Waves"-Remix auf Platz 1 der UK Charts bequem, ist mit selbigem Edit auf dem direkten Weg in die Top10 der globalen iTunes Single Charts & Spotify Charts und führt seit mehr als drei Monaten die Beatport Charts in den Top 10 an. Nach gefeierten Liveauftritten in Deutschland, den Niederlanden, Frankreich und UK greift der Osnabrücker Soundcloud-Plays-Millionär nun erneut ganz tief in seine elektronische Trickkiste und gibt mit dem housig-sanft nach vorne gehenden Remix von Lilly Wood & The Pricks „Prayer in C" schon mal einen kleinen Ausblick auf den kommenden Sommerurlaub.

Es ist eine Kollaboration der Superstars: „Prayer in C" ist das akustische Pendant zu einer sommerlichen Open Air-Partynacht in der Provence: Lavendelduft in der Luft, Glühwürmchen und eine Atmosphäre zwischen Melancholie und Euphorie. Getragen wird der Track von der absolut hinreissenden Gänsehautstimme Nili Hadidas, die mit ihrem sexy-rauchigen Timbre, den eindringlichen Lyrics sowie einer sehnsüchtigen Akustikgitarrenmelodie Benjamin Cottos für den organischen Vibe sorgt. Unterlegt wird der Remix von Robin Schulz` tightem Abgeh-Beat, der den ehemaligen Folkpop-Track zu einer energetischen Melodic House-Clubhymne umbaut. Und Schulz muss es wissen: Fast 113.000 Soundcloud-Follower können sich nicht irren, die seine Tracks insgesamt mehrere Millionen Mal geklickt haben (z. B. „Willst Du" mehr als 1.2 Millionen Mal oder „Sunset" mehr als 820.000 Mal). Und auch die millionenfach geklickten YouTube Videos zu seinen Bootlegs zeigen, dass Robin Schulz weiß, den Sound der Stunde aufzugreifen und den Massen in neuem Gewand zu servieren. Momentan ist Robin Schulz wieder auf ausgedehnter Tour durch die angesagtesten Clubs in Europa zu erleben. Und auch die eigentlichen Urheber des Tracks, das Pariser Duo Lilly Wood & The Prick muss sich Fame-mäßig keineswegs verstecken. In seiner französischen Heimat ist das Gespann Hadida/ Cotto seit dem zweifach vergoldeten Albumdebüt zu waschechten Superstars avanciert, deren Song „Into Trouble" Anfang des Jahres sogar für einen TV-Spot des Edeljuweliers Cartier verwendet wurde. Mit „Prayer in C (Robin Schulz Remix)" liefert man nun gemeinsam mit Robin Schulz den nächsten Club-Diamanten ab!

