A-Trak is one half of the duo Duck Sauce. He is the guy wearing many hats (he owns 46). Montreal-born and New York-based, our DJ hero A-Trak is a child prodigy: at the age of 15 he won the DMC World DJ Championship and is the youngest winner of the competition ever. A-Trak delivers a new fab track, an instant earworm, “Push”. House, synth pop and Andrew Wyatt’s delicate falsetto create a dance anthem. Who are the very first supporters? We go from Nicky Romero to Michael Canitrot and Felix Cartal. And what about the first remixers? Cazzette, The Chainsmokers, DallasK, GANZ and Shash’U.
The track is featured in Fifa 15 soundtrack and is getting a crazy start with over 500k plays on Soundcloud in a couple of days. What else?!
