In a recent interview MK was asked which up and comer we should all be listening to. He answered Route 94, an elusive new name in the house scene, who here provides the first new version of \'Always\' adding to an already impressive string of quality productions under his belt. The remix adeptly combines the original vibe with today\'s fuller production aesthetics, resulting in some serious attitude thanks to its bassy garage vibes, chiming synth lead and excellent utilisation of Alana\'s vocals.

