  array('local_id' => '1870','video_id' => 'kfyDGtIMngA','channel_id' => 'UCANM2BzgL6ylGFsRvx6rAug','channel_title' => 'Default','date' => '2011-08-02 14:37:25','title' => 'Nightcrawlers - Push The Feeling On [MK dub revisited edit]','descr' => '1994 - Scotland/USA

Nightcrawlers is a house music project, assembled by producer, DJ and vocalist John Reid (born 6 September 1973) from Easterhouse in Glasgow, Scotland.

The Nightcrawlers debut single "Living Inside a Dream" was not a success, but the 1992 dance song "Push the Feeling On" fared much better. In its original form the song reached #7 on the U.S. Hot Dance Club Play chart, and briefly crossed over to pop radio, peaking at #80 on the Billboard Hot 100, spending fifteen weeks on that chart.

The original version of "Push The Feeling On" was then remixed by Mark Kinchen, an American producer, who totally reinvented the track. He stripped down the song to edited vocal samples, creating an unusual sounding track.

Originally released as \'The Dub Of Doom\' mix in 1992, MK\'s remix was heavily played underground for a number of years in the UK, and reached #22 in the UK Singles Chart in October 1994 when commercially released. It was then re-released with new mixes in early 1995, making number 3, becoming Reid\'s biggest hit in his homeland.

MK continued to remix the Nightcrawlers singles, returning them to the top ten once more with "Surrender Your Love" (UK #7), "Don\'t Let The Feeling Go" (UK #13), "Let\'s Push It" (UK #23) and "Should I Ever (Fall in Love)" (UK #34).

MK also worked closely with John Reid on the Nightcrawlers album "Let\'s Push It", repeatedly remixing tracks to his trademark sound.

In 2004, thanks to new remixes of the track, "Push The Feeling On" re-entered the U.S. Dance chart, this time reaching #1.','thumbnail_default' => 'https://i.ytimg.com/vi/kfyDGtIMngA/default.jpg','thumbnail_medium' => 'https://i.ytimg.com/vi/kfyDGtIMngA/mqdefault.jpg','thumbnail_hd' => 'https://i.ytimg.com/vi/kfyDGtIMngA/hqdefault.jpg','video_status' => 'published','collection' => '','featured' => '','plays' => '5','radio_cat' => 't'),
