Manchester-born and now London-based TCTS aka Sam O\'Neill is back with a brand new EP for MTA Records, the burgeoning label helmed by Chase & Status. The 4-track \'Games\' EP follows the \'These Heights\' EP on Greco-Roman, which saw widespread support from the powerhouses of BBC Radio 1 and 1Xtra including Annie Mac, MistaJam, Cameo and more.

TCTS has a habit of picking featured vocalists who are on the brink of success and \'Games\' is no exception, with sassy new talent K Stewart kicking things off on the title track, belting it out from the get go. Assertive, strutting vocals herald effervescent percussion, lush synth work and chopped male vox for an irresistible start to the EP.

TCTS first came to everyone\'s attention with his debut EP \'Hands\' on the Cool Kid Music label, and following the success of that release Bondax snapped up his underground hit \'1997\' for their fledgling imprint Just Us. The track soon landed on the BBC Radio 1 playlist, and O\'Neill has been on the rise ever since.

