NOMINATED FOR BEST DANCE RELEASE FOR THE 2014 ARIA AWARDS
#1 ARIA CLUB CHART HIT FIVE WEEKS RUNNING (AUSTRALIA’S OFFICIAL CLUB CHART)
‘This is GREAT!’ Annie Mac – BBC Radio 1
‘Dancefloor killer’ The Magician
‘F*ckin big tune! S’sssuper into this’ Treasure Fingers
‘Ibiiizaa’ Aeroplane

With it’s 100% smile rate as the piano drops, we introduce Nicky Night Time: The new moniker from a fabled dancefloor name (or several) you know very well. (Nicky Night Time is Nick Routledge, aka Nicky Van She, frontman, co founder and producer of the band Van She). Everybody Together’ from Nicky Night Time is rapidly become a sure fire hit, hitting #1 on the Australia’s official club chart four weeks straight. #23 on the Beatport House chart and receiving repeat plays by Annie Mac ( Radio 1)  . Kiss FM UK . Australia’s Triple J and over 18 major radio stations across five continents as well as unmeasurable dance floors worldwide.

We could have taken a turn down a road of wistful reminiscing of Nicky’s history.  From the Australian top 10 debut album V, to the successful turn in Van She Tech that delivered a swag of remixes and a UK top ten with a remix of Utah Saints’ Something Good, to working with Dangerous Dan (Ksubi / Bang Gang) on a massive cover of Daft Punk’s dancefloor anthem and Bang Gang classic Around The World operating under the Nicky Van She moniker.

We could have. But its much more refreshing to talk about this crisp new tune that Nicky Night Time has just dropped in your lap and now we bring you it’s accompanying new video as filmed by Entropico in Nicky’s hometown, Sydney, Australia.

Everybody Together influences are varied: From NYC piano house to 90s pop and soul, this is a dancefloor ready house hit that delivers a fresh take on house, as inspired by the musical craft of old soul legends.

Support has flooded in from around the globe …

‘Love 5/5’ B.Traits - BBC Radio 1
