  array('local_id' => '3421','video_id' => 'qkvnAPI_M9s','channel_id' => 'UCy3Z8MNNe-CZamYN-z7d3Zw','channel_title' => 'Default','date' => '2015-09-09 13:42:35','title' => 'Kill Them With Colour - Get High','descr' => 'Forthcoming on MTA Records.

Arriving fresh on the scene with a debut of anthemic proportions, France-born Trinidad-raised Toronto resident Kill Them With Colour aka producer Wesley Marsh joins forces with Chase & Status-helmed UK label MTA Records for new single ‘Get High’. The track has already seen plaudits from leading lights including The Magician, who included it in his Magic Tape 48, and Pete Tong and Annie Mac who have played ‘Get High’ numerous times on BBC Radio 1.

Kill Them With Colour’s inspired remixes of a diverse range of artists including ZHU, Raury, Kendrick Lamar, Marian Hill, Zella Day, Lana Del Rey, A$AP Rocky and Notorious B.I.G. alongside genre-hopping and deftly produced original tracks have notched up over 8 million combined views and listens on YouTube and Soundcloud, making him a mainstay in the Hype Machine charts with Hype M Radio listing KTWC’s remix of Ariel Pink’s ‘Round and Round’ as the #9 overall remix that year. Most recently, his original song ‘Always Somethin’ garnered worldwide success, tallying over 1 million plays on Soundcloud and drawing coverage from THUMP, Complex, Hypetrak, Earmilk, Indie Shuffle, Hilly Dilly, Do Androids Dance and DJ Mag to name just a few.

His debut single proper, ‘Get High’ is a huge statement of intent, opening with rolling trap snares and a rousing female vocal before a UK flavoured 4x4 beat takes to the floor. There’s something deliciously off-kilter about it too, as a distorted flute riff (yes, flute) drops in halfway through, heralding a gargantuan breakdown. The single is backed with a moody, bass-laden VIP version along with a ramped up club-ready Extended Mix.

Live, Kill Them With Colour has played alongside the likes of Ryan Hemsworth, Cut Copy, Rudimental, Classixx, Azari & lll and Fred Falke, as well as being invited to perform at the inaugural Toronto edition of Bestival this year with SBTRKT, Jamie xx, Flume, Caribou, Dusky and more.

