        ) );

        $fields->create( array(
            'object'    => $objects->ID,
            'alias'     => 'radio_category',
            'type'      => 'text',
            'label'     => 'Radio Category',
            'value'     => $channel['radio_cat'],
            'status'    => 1
        ) );

        echo $channel['title'] .': ('. $done .')<br>';

    }

}

